import React from "react";
import Cards from "../cards";
import Burger from "../menuBurger";
import styled from "styled-components";
import Aside from "../aside";

const Container = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  width: 100%;
  height: 100vh;
  @media only screen and (max-width: 768px) {
    margin-top: 50px;
  }
`;

const Span = styled.span`
  @media only screen and (max-width: 768px) {
    width: 100%;
    display: flex;
    height: 50px;
    background-color: #00652e;
  }
`;

function Home() {
  const veiculos = [
    {
      nome: "Scania G500",
      ano: "2019",
      valor: "R$ 639.666,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",
    },
    {
      nome: "Scania G500 XT 8x4",
      ano: "2019",
      valor: "R$ 745.000,00",
      imagem: "https://i.ytimg.com/vi/Y-jjCy6lLWY/maxresdefault.jpg",
    },
    {
      nome: "Scania G440 6x4",
      ano: "2020",
      valor: "R$ 630.000,00",
      imagem:
        "https://cdn.salaodocarro.com.br/_upload/caminhoes/2020/05/13/scania-g-440-2013-branco-2226-0.jpg",
    },
    {
      nome: "Mercedes-benz actros 6x4",
      ano: "2021/2022",
      valor: "R$ 455.000,00",
      imagem:
        "https://production.autoforce.com/uploads/picture/image/155764386/used_model_webp_comprar-actros-2651-1794-e8d5aa50-b878-4663-b7bf-1c38e9b214f5_68937e117a.png.webp",
    },
    {
      nome: "Volvo FH 540 6x4",
      ano: "2022",
      valor: "R$ 880.000,00",
      imagem:
        "https://brasil.agrofystatic.com/media/catalog/product/cache/1/image/850x600/0dc2d03fe217f8c83829496872af24a0/c/a/caminh-o-volvo-fh-540-6x4t-glo-Tracbel-agrofy-3-20220411235514.jpeg?usewebp=true",
    },
    {
      nome: "Volkswagen 19 360",
      ano: "2021/22",
      valor: "R$ 410.000,00",
      imagem:"https://s3.amazonaws.com/trucadao-production-eua/system/imagens_anuncios/imagems/001/255/597/big_thumb/cdd229e38d.jpg?1657287881"
    },
    {
      nome: "Mercedes Benz MB2544",
      ano: "2010/10",
      valor: "R$ 210.000,00",
      imagem:"https://s3.amazonaws.com/trucadao-production-eua/system/imagens_anuncios/imagems/001/330/490/big_thumb/defba048a7.jpg?1674746455"
    },
    {
      nome: "Volvo FM370",
      ano: "2011/11",
      valor: "R$ 200.000,00",
      imagem:"https://s3.amazonaws.com/trucadao-production-eua/system/imagens_anuncios/imagems/001/330/490/big_thumb/defba048a7.jpg?1674746455"
    }
];
  return (
    <>
      <Burger />
      <Span />
      <div>
        <Aside label="Scania" />
        <Container>
          {veiculos.map((veiculo) => (
            <Cards
              key={veiculo.nome}
              nome={veiculo.nome}
              ano={veiculo.ano}
              imagem={veiculo.imagem}
              valor={veiculo.valor}
            />
          ))}
        </Container>
      </div>
    </>
  );
}
export default Home;
